INSERT INTO `craft_matrixcontent_myblock` (`id`, `elementId`, `locale`, `field_multipleBlocks_myBlockDescription`, `field_multipleBlocks_myBlockUrl`, `field_multipleBlocks_myBlockSummary`, `field_singleBlock_myBlockDescription`, `field_singleBlock_myBlockUrl`, `field_singleBlock_myBlockSummary`, `field_footer_footerContent`, `field_multipleBlocks_coloroption`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('9', '44', 'en_gb', 'my block heading', '', '<p>test group block 1</p>', NULL, NULL, NULL, NULL, NULL, '2016-02-16 20:10:28', '2016-02-16 20:23:29', '50dec8cf-0f5d-4e6d-8974-1130bd9576a0');
INSERT INTO `craft_matrixcontent_myblock` (`id`, `elementId`, `locale`, `field_multipleBlocks_myBlockDescription`, `field_multipleBlocks_myBlockUrl`, `field_multipleBlocks_myBlockSummary`, `field_singleBlock_myBlockDescription`, `field_singleBlock_myBlockUrl`, `field_singleBlock_myBlockSummary`, `field_footer_footerContent`, `field_multipleBlocks_coloroption`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('10', '45', 'en_gb', '', '', '<p>test group block 2</p>', NULL, NULL, NULL, NULL, NULL, '2016-02-16 20:10:28', '2016-02-16 20:23:29', 'd8cbdd4f-b2bd-4d66-9e95-58a2c11caa8a');
INSERT INTO `craft_matrixcontent_myblock` (`id`, `elementId`, `locale`, `field_multipleBlocks_myBlockDescription`, `field_multipleBlocks_myBlockUrl`, `field_multipleBlocks_myBlockSummary`, `field_singleBlock_myBlockDescription`, `field_singleBlock_myBlockUrl`, `field_singleBlock_myBlockSummary`, `field_footer_footerContent`, `field_multipleBlocks_coloroption`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('11', '46', 'en_gb', NULL, NULL, NULL, '', '', '<p>Hi! I am liz and I am passionate about the work I do. I am committed \r\nto improving sex and relationships education and young people\'s \r\nentitlement to it. I have worked in the field of sexual health promotion\r\n for 15 years now. I currently work on a freelance basis offering a \r\nvariety of services including planning, delivering and evaluating \r\ntraining courses for professionals in health, social care, education and\r\n youth work; delivering lessons and workshops to young people; \r\nconducting needs assessments and small scale pieces of research. If you \r\nwant to know more about my work then please contact me.</p><p><br></p><p><strong>My background:</strong></p><p>I\r\n worked as a Senior Sexual Health Promotion Practitioner for the NHS in \r\nBrighton & Hove for 12 years. The main areas of my work were: \r\nworkforce development for practitioners, delivering workshops and \r\nseminars, co-ordinating a condom promotion scheme and C-Card scheme, \r\nproducing resources including a \'Risk workbook\' based on Motivational \r\ninterviewing, leading on local sexual health media campaigns, chairing \r\nlocal partnership forums and supporting policy & strategy \r\ndevelopment in the field of teenage pregnancy and sexual health.</p><p>I\r\n have a Masters Degree in Health Promotion from Brighton University \r\nwhere I conducted a piece of qualitative research exploring on the \r\ninfluence of pornography on young men’s sexual health - their attitudes,\r\n sexual development and behavior. My undergraduate degree is a BA (Hons)\r\n in Educational Perspectives from Oxford Brookes University, within this\r\n I conducted a qualitative piece of research critiqing school sex and \r\nrelationships education, this was where my interest began in this field.</p><p>I\r\n have also been working as an associate trainer for the FPA for 6 years \r\ndelivering the course \'Fantasy Vs Reality: The impact and influence of \r\npornography on young people\' to practitioners across England and I am \r\nalso involved in work for the FPA to explore the links between alcohol \r\nand sexual risk taking amongst young people.</p><p><br></p><p><strong>My approach:</strong></p><p>I\r\n take a professional and conscientious approach to my work. I ensure my \r\ndelivery is participatory and inclusive within an informal style. I feel\r\n this work takes an amazing journey of exploring attitudes, beliefs, \r\npersonal self awareness and insight. I believe we always need to ensure \r\nwe look after ourselves and continually self reflect in this demanding \r\narea of work. I love meeting practitioners from a range of disciplines \r\nand from all over the UK, this for me, informs, shapes and inspires my \r\nideas and work ensuring I take a very real and grounded approach.</p><p><strong><strong>Contact me by email</strong> <a href=\"mailto:lizdeanfreelance@yahoo.co.uk\">lizdeanfreelance@yahoo.co.uk</a> or 07980 575353</strong><br></p>', NULL, NULL, '2016-02-16 20:10:28', '2016-02-16 20:23:30', '6017edd1-f42b-4a93-803b-269c2641944c');
