INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('42', 'field', '7', 'en_gb', ' my block heading globe test group block 1 heart test group block 2 textboxdots hi i am liz and i am passionate about the work i do i am committed to improving sex and relationships education and young people s entitlement to it i have worked in the field of sexual health promotion for 15 years now i currently work on a freelance basis offering a variety of services including planning delivering and evaluating training courses for professionals in health social care education and youth work delivering lessons and workshops to young people conducting needs assessments and small scale pieces of research if you want to know more about my work then please contact me my background i worked as a senior sexual health promotion practitioner for the nhs in brighton hove for 12 years the main areas of my work were workforce development for practitioners delivering workshops and seminars co ordinating a condom promotion scheme and c card scheme producing resources including a risk workbook based on motivational interviewing leading on local sexual health media campaigns chairing local partnership forums and supporting policy strategy development in the field of teenage pregnancy and sexual health i have a masters degree in health promotion from brighton university where i conducted a piece of qualitative research exploring on the influence of pornography on young men s sexual health their attitudes sexual development and behavior my undergraduate degree is a ba hons in educational perspectives from oxford brookes university within this i conducted a qualitative piece of research critiqing school sex and relationships education this was where my interest began in this field i have also been working as an associate trainer for the fpa for 6 years delivering the course fantasy vs reality the impact and influence of pornography on young people to practi